Patch Set 2:

@Zhi yeah!, you know it's the strangest thing that it seems to work fine locally on the development boxes (ubuntu/ubuntu server/fedora19 server for me) and fails intermittently on jenkins. I'm sure you can find more imports in glance (and openstack in general which use the "as" option).

My best guess at this point is that there is some weirdness in the python interpreter that is used on some of the jenkins infrastructure. (It's not related to py26 or py27 - is what we've observed) However, it may be the variation in distros that might make the difference. I'm not sure :/
